'''剑指 Offer 40. 最小的k个数'''
# 方法一、对所有元素进行排序，然后取出第K个元素
# 方法二、使用选择排序或者冒泡排序，进行K次选择，可得到第K大的数 时间复杂度：O(n*k)，是有序的
# 方法三、类快排、小顶堆(只是需要知道k个数，不一定有序)

'''类快排'''
# 随机选取枢纽，得到比枢纽小和比枢纽大两部分，若比枢纽大的部分数量等于K-1，返回当前枢纽；
# 若大于k-1，则在比枢纽大的部分继续查找，重复该过程

'''使用快排实现'''
def getLeastNumbers(arr, k):
    if not arr or not k: return []
    if len(arr) <= k: return arr
    # 使用快速排序
    start = 0
    end = len(arr) - 1
    index = 0

    while index != k-1 :
        # if index < k-1:
        #     start = index + 1  # 必须
        #     index = quicksort(arr, start, end)
        # if index > k-1:
        #     end = index - 1 # 必须
        #     index = quicksort(arr, start, end)
        index = quicksort(arr, start, end)
        if index < k-1:
            start = index + 1
        else:
            end = index - 1
    return arr[:k]

def quicksort(arr, start, end):
    # 没有if start < end
    i, j = start, end
    base = arr[i]
    while i < j:
        while i < j and arr[j] >= base:
            j -= 1
        arr[i] = arr[j]
        while i < j and arr[i] <= base:
            i += 1
        arr[j] = arr[i]
    arr[i] = base
    return i

